import logo from './logo.svg';
import './App.css';

function App() {
  const apiKey = '72095579eb8b2c9381a1d588e381fcbe';
  const httpRequire =  'https://api.openweathermap.org/data/2.5/weather';
  const current = new Date()
  const temperature = "15";
  return (
    <div className="App">
      <main>
        <div className='searchCity' >
          <input type="text" className="searchBar" placeholder="Search City"/>
        </div>
        <div className="place">
          <h2>Tatuí, Br</h2>
        </div>
        <div className="dates">
          <h2>{current.UTDate()}/{current.UTMonth()+1}/{current.UTFullYear()}</h2>
          <h3>{current.UTHours()}:{current.UTMinutes() < 10? 0 + current.UTMinutes() : current.UTMinutes()}:{current.UTSeconds()}</h3>
        </div>
        <div className='temperature'>
          <p className="temperatureDisplay">{temperature+"ºC"}</p>
        </div>
      </main>
    </div>
  );
}

export default App;
